import { jsPDF } from "jspdf"
var font = '';

export default function registerMyanmarFont() {
    jsPDF.API.events.push([
        "addFonts",
        function () {
            this.addFileToVFS("NotoSansMyanmar.ttf", font);
            this.addFont("NotoSansMyanmar.ttf", "NotoSansMyanmar", "normal");
        },
    ]);
}
